<?phpnamespace Nemundo\Content\Index\Tree\Install;use Nemundo\App\Application\Setup\ApplicationSetup;use Nemundo\App\Application\Type\Install\AbstractInstall;use Nemundo\App\WebService\Setup\ServiceRequestSetup;use Nemundo\Content\Action\Setup\ActionSetup;use Nemundo\Content\Index\Tree\Action\ChildOrder\ChildOrderContentAction;use Nemundo\Content\Index\Tree\Action\TreeContentAction;use Nemundo\Content\Index\Tree\Action\ViewChange\ViewChangeContentAction;use Nemundo\Content\Index\Tree\Application\TreeIndexApplication;use Nemundo\Content\Index\Tree\Data\TreeModelCollection;use Nemundo\Content\Index\Tree\Service\BreadcrumbService;use Nemundo\Content\Index\Tree\Service\ParentTreeSearchService;use Nemundo\Content\Index\Tree\Service\TreeDeleteService;use Nemundo\Content\Index\Tree\Service\TreePostService;use Nemundo\Content\Index\Tree\Service\ChildTreeSearchService;use Nemundo\Model\Setup\ModelCollectionSetup;class TreeInstall extends AbstractInstall{    public function install()    {        (new ModelCollectionSetup())            ->addCollection(new TreeModelCollection());        (new ActionSetup())            ->addContentAction(new TreeContentAction());            /*->addContentAction(new ChildOrderContentAction())            ->addContentAction(new ViewChangeContentAction());*/        (new ServiceRequestSetup(new TreeIndexApplication()))            ->addService(new TreePostService())            ->addService(new TreeDeleteService())            ->addService(new BreadcrumbService())            ->addService(new ParentTreeSearchService())            ->addService(new ChildTreeSearchService());    }}